const HomePage = () => {
    return (

        <div
            className="min-h-screen bg-cover bg-center flex"
            style={{
                backgroundImage: "url('https://images.unsplash.com/photo-1451187580459-43490279c0fa?q=80&w=3872&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D')"
            }}
        >

            
            <div>
                <h1 className="text-center text-3xl py-5">AssetEye Home</h1>
                <h3 className="text-center text-xl py-5">Have an account? <a className="text-blue-400" href="/login">Login</a></h3>
                <h3 className="text-center text-xl py-5">Need an account? <a className="text-blue-400" href="/register">Register</a></h3>
            </div>
        </div>

    )
}

export default HomePage
